import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub } from '@fortawesome/free-brands-svg-icons';

export const Prices = () => {
    const redirectToGithub = () => {
        window.location.href = 'https://github.com/rendizi/noleetcheat';
    };

    return (
        <div id="pricing" className="flex flex-col justify-center items-center mt-20">
            <h2 className="text-5xl">AND IT'S ALL FOR FREE</h2>
            <p className='text-xl mt-5'>At the moment you can get it in github, but supports only chromium based browsers</p>
            <a href="https://github.com/rendizi/noleetcheat" target='_blank'>
            <FontAwesomeIcon 
                icon={faGithub} 
                size="3x" 
                className="mt-4 cursor-pointer" 
                onClick={redirectToGithub} 
            />
            </a>
        </div>
    );
};
